import React, {useState} from 'react';
import Icon from 'react-native-vector-icons/Feather';
import Icon2  from 'react-native-vector-icons/AntDesign';
import Icon3 from 'react-native-vector-icons/MaterialIcons';
import {View, SafeAreaView, Text, StyleSheet, TextInput, FlatList, Image, ScrollView, TouchableOpacity} from 'react-native';
import {status} from './list';
import {products} from './list';
import {productsPage2} from './list';
import {products2Page2} from './list';
import {VectorHeader2} from '../../components/screenComponents/components';
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";
import styled from 'styled-components/native';



const Tabs = createMaterialTopTabNavigator();


const StyledText= styled.Text`
  
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
text-align: center;
letter-spacing: -0.333333px;

color: #FFFFFF;
`;

const StyledText1= styled.Text`
  
font-family: 'Roboto';
font-style: normal;
font-weight: 700;
font-size: 36px;
line-height: 42px;
text-align: center;
letter-spacing: -0.333333px;

color: #FFFFFF;
`;

const StyledImage= styled.Image`
width: 42px;
height: 42px;
border-radius:50px;
`;


const Products=()=>{
	return(
		<View style={{flex:1, backgroundColor:'#000000'}}>
				<FlatList
						data={products}
						numColumns={3}
						showsVerticalScrollIndicator={false}
						keyExtractor={(item, index)=>index.toString()}
						renderItem={({item, index})=>
							<View style={styles.imageVieww}>
							
								<Image source={item.image} style={styles.image} key={index}/>
								<Text style={styles.brandName}>Product Name</Text>
								<Text style={styles.km}>N0.00</Text>
							</View>
						}
						/>

			</View>
		)
}
const Posts=()=>{
	return(
		<View style={{alignItems:'center', justifyContent:'center', flex:1, backgroundColor:'#000000'}}>
			<View>
				<StyledImage source={require('../assets/ad.png')}/>
				<View>
					<View>
						<Text>User Name</Text>
						<Text>@handle</Text>
						<View></View>
					</View>
					<View>
						<Text>So I came across this awesome brand that sells ankara bracelets and pendants, they looked really awesome!!!</Text>
					</View>
				</View>

			</View>
			</View>
		)
}
const Reviews=()=>{
	return(
		<View style={{alignItems:'center', justifyContent:'center', flex:1, backgroundColor:'#000000'}}>
			</View>
		)
}




export default function Ecommerce3({navigation}){
	const [brandView, setBrandView]= useState(true);
	const handleBrandView = ()=>{
		setBrandView(!brandView)
	}
	const handleCart = ()=>{navigation.navigate('Ecommerce6')};
	
	return(
		<SafeAreaView style= {styles.container}>
			<VectorHeader2
			goBack={()=>navigation.goBack()}
			handleBrandView={()=>handleBrandView()}
			handleCart={()=>handleCart()}/>
			<View style={styles.header}>
				<View>
					<Image source={require('../assets/header.png')} style={styles.imageAd}/>
					<Image source={require('../assets/header2.png')} style={styles.profile}/>
				</View>
				

			</View>
			<View style={{alignItems:'center'}}>
				<StyledText1>Brand Name</StyledText1>
				<View style={{alignItems:'center', justifyContent:'center', width:'90%' }}>
				<StyledText >Brand Description: Lorem ipsum dolor, sit ahmet... This is pretty much the brandâ€™s bio.</StyledText>
				</View>
			</View>
			<View style={styles.buttons}>
				<TouchableOpacity style={styles.button}><Text style={{fontSize:15}}>Follow</Text><Icon2 name="plus" style={{marginLeft:20}} size={25} /></TouchableOpacity>
				<TouchableOpacity style={styles.button}><Text style={{fontSize:15}}>Share</Text><Icon2 name="sharealt" style={{marginLeft:15}} size={25} /></TouchableOpacity>
			</View>

			 <Tabs.Navigator
            headerMode="none"
            screenOptions={{
                tabBarShowIcon: true,
                tabBarActiveTintColor: '#fff',
        	  tabBarInactiveTintColor: '#ddd',
                tabBarIndicatorStyle: {
                    backgroundColor: '#C3AD60',
                },

                tabBarStyle: {
                    borderTopWidth: 2,
                    elevation: 10,
                    backgroundColor: '#000',
                    borderRadius: 1

                }
            }}>
            	 <Tabs.Screen
                name="Products"
                component={Products}
                options={{
      headerShown: false,}}
            />
            <Tabs.Screen
                name="Posts"
                component={Posts}
                options={{
      headerShown: false,}}
            />
             <Tabs.Screen
                name="Reviews"
                component={Reviews}
                options={{
      headerShown: false,}}
            />
            
            </Tabs.Navigator>
		</SafeAreaView>


		)
}
const styles = StyleSheet.create({
	container:{
		flex:1,
		backgroundColor:'#000000',
	},
	industry:{
		height:'30%', 
		justifyContent:'center'
	},
	industryText:{
		color:'#C3AD60', 
		fontFamily:'Roboto', 
		fontWeight:'400', 
		fontSize:15, 
		lineHeight:21.09, 
		marginLeft:20
	},
	seeAllView:{
		alignItems:'flex-end', 
		marginRight:20
	},
	seeAll:{
		color:'white',  
		fontSize:12, 
		fontFamily:'Roboto', 
		fontWeight:'700', 
		lineHeight:14,
		marginLeft:20
	},
	brandName:{
		fontSize:17, 
		fontWeight:'400', 
		fontFamily:'Roboto', 
		color:'#fff', 
		fontSize:15,
		paddingBottom:5
	},
	km:{
		color:'#4E4E4E', 
		fontFamily:'Roboto',
	},
	input:{
		backgroundColor:'#444444',
		borderColor:'#777777',
		borderRadius:8,
		width:'90%',
		height:'50%'
		
	},	
	inputView:{
		alignItems:'center',
		justifyContent:'center',
		height:'10%'
	},
	image:{
		height:60,
		width:60,
		margin:20,
		borderRadius:5
	},
	image2:{
		borderRadius:50,
		width:55,
		height:55,
		marginLeft:25
	},

	imageView:{
		alignItems:'center',
		justifyContent:'center'
	},
	imageVieww:{
		alignItems:'center',
		justifyContent:'center',
		margin:10,
		padding:0
	},
	imageVieww2:{
		flexDirection:'row',
		margin:0,
		padding:0
	},
	header:{
		marginBottom:50
	},
	imageAd:{
		height:90,
		width:'100%',
		position:'absolute'
	},
	profile:{
		height:90,
		width:90,
		zIndex:1,
		left:'39%',
		top:'50%',
		padding:0,
		margin:0
	},
	button:{
		borderRadius:25,
		backgroundColor:'#C3AD60',
		width:128,
		height:48,
		justifyContent:'center',
		alignItems:'center',
		flexDirection:'row'
	},
	buttons:{
		flexDirection:'row',
		justifyContent:'space-around',
		marginTop:30,
		marginBottom:30
	}


})
